using namespace std;

int partition(int *arr, int p, int r){
    int i=p-1;
    int x=arr[r];
    for (int j=p; j<r; j+=1){
        if (arr[j]<=x){
            i+=1;
            swap(arr[i], arr[j]);
        }
    }
    swap(arr[i+1], arr[r]);
    return i+1;
}

void Quicksort(int *arr, int p, int r){
    if (p<r){
        int q = partition(arr, p, r);
        Quicksort(arr, p, q-1);
        Quicksort(arr, q+1, r);
    }
}

